import React from 'react'
import Tech from '../../Tech/Tech'
import Latest from '../Latest/Latest';
import Article from '../LatestArticle.jsx/Aarticle';
import Latestheading from '../Latestheading/Latestheading';
import LatestStories from '../LatestStories/LatestStories';
import maintech from './maintech.css';
function MainTech() {
    return (
        <div className='adjust-all'>
            <Latestheading data={{ name1: "Technology" }} />
            <div className='main-tech'>
                <Tech heading={"Atom and Charge"} />
                <Tech heading={"Universe"}/>
                <Tech heading={"Magnitic field"}/>
                <Tech heading={"Rocket"}/>
                <Tech heading={"Gravity"}/>
                <Tech />
                <Latest/>
            </div>
        </div>
    )
}

export default MainTech
